class KML {
  KML._(this._bc, this._bcOffset);
  factory KML(List<int> bytes) {
    final rootRef = fb.BufferContext.fromBytes(bytes);
    return reader.read(rootRef, 0);
  }

  static const fb.Reader<KML> reader = _KMLReader();

  final fb.BufferContext _bc;
  final int _bcOffset;

  ///  Document name
  String? get NAME => const fb.StringReader().vTableGetNullable(_bc, _bcOffset, 4);
  ///  Document description
  String? get DESCRIPTION => const fb.StringReader().vTableGetNullable(_bc, _bcOffset, 6);
  ///  Whether document is visible
  bool get VISIBILITY => const fb.BoolReader().vTableGet(_bc, _bcOffset, 8, false);
  ///  Whether document is open in tree view
  bool get OPEN => const fb.BoolReader().vTableGet(_bc, _bcOffset, 10, false);
  ///  Shared styles
  List<Kmlstyle>? get STYLES => const fb.ListReader<Kmlstyle>(Kmlstyle.reader).vTableGetNullable(_bc, _bcOffset, 12);
  ///  Style maps
  List<KmlstyleMap>? get STYLE_MAPS => const fb.ListReader<KmlstyleMap>(KmlstyleMap.reader).vTableGetNullable(_bc, _bcOffset, 14);
  ///  Top-level placemarks
  List<Kmlplacemark>? get PLACEMARKS => const fb.ListReader<Kmlplacemark>(Kmlplacemark.reader).vTableGetNullable(_bc, _bcOffset, 16);
  ///  Top-level folders
  List<Kmlfolder>? get FOLDERS => const fb.ListReader<Kmlfolder>(Kmlfolder.reader).vTableGetNullable(_bc, _bcOffset, 18);
  ///  Network links
  List<KmlnetworkLink>? get NETWORK_LINKS => const fb.ListReader<KmlnetworkLink>(KmlnetworkLink.reader).vTableGetNullable(_bc, _bcOffset, 20);
  ///  Ground overlays
  List<KmlgroundOverlay>? get GROUND_OVERLAYS => const fb.ListReader<KmlgroundOverlay>(KmlgroundOverlay.reader).vTableGetNullable(_bc, _bcOffset, 22);

  @override
  String toString() {
    return 'KML{NAME: ${NAME}, DESCRIPTION: ${DESCRIPTION}, VISIBILITY: ${VISIBILITY}, OPEN: ${OPEN}, STYLES: ${STYLES}, STYLE_MAPS: ${STYLE_MAPS}, PLACEMARKS: ${PLACEMARKS}, FOLDERS: ${FOLDERS}, NETWORK_LINKS: ${NETWORK_LINKS}, GROUND_OVERLAYS: ${GROUND_OVERLAYS}}';
  }
}

class _KMLReader extends fb.TableReader<KML> {
  const _KMLReader();

  @override
